import React, {Component} from "react"

import skyline from './imgs/skyline.svg';
import title from './imgs/logo.svg';

function importAll(r) {
  return r.keys().map(r);
}

const member_monday_images = importAll(require.context('./imgs/front_page_imgs/', false, /\.(JPG)$/));

class HomeComponent extends Component{
  render(){
    return(
      <div>
        <div style={{height:"100vh", position:"relative"}}>
          <img src={skyline} style={{opacity:0.5, width:"100vw", position:"absolute", left:"0", bottom:"0"}}/>
          <img src={title} style={{width:"80vw", position:"absolute", top:"15vh", marginLeft:"auto", marginRight:"auto", left:"0", right:0, zIndex:1}} />
        </div>
        <div>
        </div>
      </div>
    )
  }
}

export default HomeComponent;
